    before('Open App', function () {
        browser.url('');
    });

    it('TC-026 Submit button is enabled after fields 1-4 are filled in with valid values', function () {
        $(sel.name).setValue("SuperGirl(*|*)");
        $$(sel.radioButtons)[1].click();
        $(sel.age).setValue("1234567890");
        $(sel.storyType).click();
